public class DataQualityJobDefinitionFactory(string resourceName = null, Action<Humidifier.SageMaker.DataQualityJobDefinition> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.DataQualityJobDefinition>(resourceName)
{

    internal InnerDataQualityJobDefinitionDataQualityJobInputFactory DataQualityJobInputFactory { get; set; }

    internal InnerDataQualityJobDefinitionDataQualityAppSpecificationFactory DataQualityAppSpecificationFactory { get; set; }

    internal InnerDataQualityJobDefinitionStoppingConditionFactory StoppingConditionFactory { get; set; }

    internal InnerDataQualityJobDefinitionMonitoringResourcesFactory JobResourcesFactory { get; set; }

    internal InnerDataQualityJobDefinitionNetworkConfigFactory NetworkConfigFactory { get; set; }

    internal InnerDataQualityJobDefinitionMonitoringOutputConfigFactory DataQualityJobOutputConfigFactory { get; set; }

    internal InnerDataQualityJobDefinitionDataQualityBaselineConfigFactory DataQualityBaselineConfigFactory { get; set; }

    protected override Humidifier.SageMaker.DataQualityJobDefinition Create()
    {
        var dataQualityJobDefinitionResult = CreateDataQualityJobDefinition();
        factoryAction?.Invoke(dataQualityJobDefinitionResult);

        return dataQualityJobDefinitionResult;
    }

    private Humidifier.SageMaker.DataQualityJobDefinition CreateDataQualityJobDefinition()
    {
        var dataQualityJobDefinitionResult = new Humidifier.SageMaker.DataQualityJobDefinition
        {
            GivenName = InputResourceName,
        };

        return dataQualityJobDefinitionResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.DataQualityJobDefinition result)
    {
        base.CreateChildren(result);

        result.DataQualityJobInput ??= DataQualityJobInputFactory?.Build();
        result.DataQualityAppSpecification ??= DataQualityAppSpecificationFactory?.Build();
        result.StoppingCondition ??= StoppingConditionFactory?.Build();
        result.JobResources ??= JobResourcesFactory?.Build();
        result.NetworkConfig ??= NetworkConfigFactory?.Build();
        result.DataQualityJobOutputConfig ??= DataQualityJobOutputConfigFactory?.Build();
        result.DataQualityBaselineConfig ??= DataQualityBaselineConfigFactory?.Build();
    }

} // End Of Class

